import React from 'react';

const NavBar = () => {
  const [isOpen, setIsOpen] = useState(false); // Controle do estado de visibilidade do menu

  const toggleMenu = () => {
    setIsOpen(!isOpen); // Alterna entre aberto e fechado
  };

  return (
    <div className="HeaderNav">
      {/* Ícone de hambúrguer, visível apenas em telas pequenas */}
      <div className="menu-icon" onClick={toggleMenu}>
        &#9776; {/* Unicode para o ícone de hambúrguer */}
      </div>

      {/* Navegação */}
      <nav className={`nav-links ${isOpen ? "open" : ""}`}>
        <a href="#">Home</a>
        <a href="#">Serviços</a>
        <a href="#">Contato</a>
        <a href="#">Sobre</a>
      </nav>
    </div>
  );
};

export default HeaderNav;
